import React from "react";
import NavIcon from "./NavIcon";

import '../style/nav.scss';

export default function Nav(){
    return(
        <nav className="nav-bar">
            <NavIcon className="nav-burger-icon" img="/assets/icons/tables/burger-icon.svg" style={{width: "80%!important;"}}/>
            <NavIcon img="/assets/icons/hotdish-icon.svg" />
            <NavIcon img="/assets/icons/tables/employee-icon.svg" />
            <NavIcon img="/assets/icons/tables/schedule-icon.svg" />
            <NavIcon img="/assets/icons/tables/inventory-icon.svg" />
            <NavIcon img="/assets/icons/tables/reports-icon.svg" />
            <NavIcon img="/assets/icons/tables/settings-icon.svg" />
        </nav>
    )
}
